import { useEffect, useState } from 'react';
import Button from './Button.js';

function Liste_page(){
    return(
        <div class = "container" style={{ backgroundColor: '#202730' }}>
            <div class = "row">
                <div className="col-md-3">
                    <Button text ="Mathématique" className = "matière mb-3">Mathématique</Button>
                    <Button text ="Physique Chimie" className = "matière mb-3">Physique Chimie</Button>
                </div>
                <div className="col-md-3">
                    <Button text ="Histoire" className = "matière mb-3">Histoire</Button>
                    <Button text ="Français" className = "matière">Français</Button>
                </div>
            </div>
        </div>
    )
}

export default Liste_page;
